import React, { useState } from 'react';
import styled from 'styled-components';
import PropTypes from 'prop-types';
import Sidebar from '../Core/Sidebar/sidebar';
import Headers from '../Core/Headers/Headers';
import Department from '../Admin/Department_List';
const Table = styled.div``;
const Row = styled.div`margin-top: 10px;`;
const HR = styled.hr`
	border: 0.125rem solid white;
	margin-top = 5px ;
	`;
const table = styled.table`border: 1px solid black;`;
const Label = styled.label`padding-top: 1rem;`;

class PositionList extends React.Component {
	render() {
		return (
			<div>
				<Department formname="Position Form" formtitle="Position" />
			</div>
		);
	}
}

PositionList.propTypes = {};

export default PositionList;
